import React from "react";
import { 
    MDBCard,
    MDBCardBody,
    MDBCardHeader,
    MDBCardImage,
    MDBCardFooter,
    MDBRipple,
    MDBRow,
    MDBCol
 } from "mdb-react-ui-kit";




export function ProfileCard(props) {

    const {cardPicUrl,countryName} = props

    function drag(ev) {
        ev.dataTransfer.setData("text", ev.target.id);
      }

    return(
        <MDBCard className="profileCard-card" draggable="true" ondragstart={drag}
            alignment='center'>
            <MDBCardImage className="" src={cardPicUrl} position="top" fluid alt='...' />
            <MDBCardFooter>{countryName}</MDBCardFooter>
        </MDBCard>
    )

}
